@Override
public List<String> getEurekaServerServiceUrls(String myZone) {
  List<String> urls = bizConfig.eurekaServiceUrls();
  return CollectionUtils.isEmpty(urls) ? super.getEurekaServerServiceUrls(myZone) : urls;
}
